// import Index from "./Pages/RouterChallange/Index";
const App = () => {
  const url = "https://dummyapi.io/data/v1/post?limit=10";

  const options = {
    method: "GET",
    headers: {
      "app-id": "636e136b8af6961b47361447",
    },
  };

  fetch(url, options)
    .then((res) => res.json())
    .then((json) => console.log(json))
    .catch((err) => console.error("error:" + err));

  return <div>Home</div>;
};

export default App;
